import React, { useState } from 'react';

function Profile({ avatar, name, bio }) {
  return (
    <div className="profile">
      <img src={avatar} alt={`${name}'s avatar`} />
      <h2>{name}</h2>
      <p>{bio}</p>
    </div>
  );
}

export default Profile;
